The self-attention mechanism ( Dao 2022 ) is at the heart of the transformer performance but is also a major bottleneck in terms of memory and computational cost. One of the most successful optimizations for the attention mechanism is the Flash Attention paper. Suppose we have an input sequence of embeddings X=(x1​,...,xN​) where xi​∈Rk, such that X∈Rk×N. The transformer stores parameters Wq​,Wk​,Wv​∈Rk×d, such that Q=XT⋅Wq​,K=XT⋅Wk​,V=XT⋅Wv​ such that Q,K,V∈RN×d. The self-attention matrix S=QKT∈RN×N is then computed to represent the pairwise interaction between tokens at position i (ith row) and position j (jth column). The row-wise softmax is taken P=softmax(S) to convert these into probabilities and finally the output is O=P⋅V. Typically, N is much larger than the hidden dimensions k,d, as N can be 2,048 or larger. Hence the QKT∈RN×N matrix is the bottleneck for memory and computation. The flash attention proposes to do this computation in a block-wise manner to reduce the memory usage. Furthermore, the algorithm also speeds up the computation compared to naive attention because the block-wise implementation minimizes the number of read-write operations between the faster SRAM and slower HBM. More details can be found in the notebook at Dao 2022 - FlashAttention . We can utilize flash attention like so: %pip install optimum model.to_bettertransformer() Note that this is only supported for models that have implemented flash attention, e.g. gpt-neox, bloom etc. Flash Attention is now support natively within Pytorch as torch.nn.functional.scaled_dot_product_attention (see blog ). The usage is like below. We need transformers>=4.36 and torch>=2.1.1 to use it. from optimum.bettertransformer import BetterTransformer
from transformers import AutoModelForCausalLM model = AutoModelForCausalLM.from_pretrained("gpt2-large", torch_dtype=torch.float16)
model = BetterTransformer.transform(model, keep_original_model=False)

